import android from '../src/Images/Android.jpg';
import digital from '../src/Images/digital.jpg';
import ios from '../src/Images/ios.jpg';
import mac from '../src/Images/macintosh.jpg';
import software from '../src/Images/software.png';
import web from '../src/Images/spaceX.jpg'

const Sdata = [
    {
        imgsrc: web,
        title: 'Web Development'
    },
    {
        imgsrc: android,
        title: 'Android Development'
    },
    {
        imgsrc: digital,
        title: 'Digital Marketing'
    },{
        imgsrc: ios,
        title: 'iOS Development'
    },{
        imgsrc: software,
        title: 'Software Development'
    },
    {
        imgsrc: mac,
        title: 'Macintosh Development'
    }
];
export default Sdata;
